import classes from './MealItem.module.css'

let MealItem = (props)=>{
    return(
        <>
        <li>
            <div className={classes.meal}>
            <h3> {props.name} </h3>
            <div className={classes.description}>
                {props.description}
            </div>
            <div className={classes.price}>
                {props.price}
            </div>
            </div>
        </li>
        </>
    )
}

export default MealItem
